import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './Home.css';

const Home = () => {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');

  useEffect(() => {
    fetchCars();
  }, [startDate, endDate, searchTerm]);

  const fetchCars = async () => {
    try {
      setLoading(true);
      const params = {};
      if (startDate) params.startDate = startDate;
      if (endDate) params.endDate = endDate;
      if (searchTerm) params.search = searchTerm;

      const response = await axios.get('/api/cars', { params });
      setCars(response.data);
    } catch (error) {
      console.error('Error fetching cars:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = (e) => {
    e.preventDefault();
    fetchCars();
  };

  return (
    <div className="home">
      <div className="hero-section">
        <div className="container">
          <h1>Find Your Perfect Car</h1>
          <p>Book a car for your next adventure</p>
          <form onSubmit={handleSearch} className="search-form">
            <input
              type="text"
              placeholder="Search by name, brand, or model..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="search-input"
            />
            <input
              type="date"
              value={startDate}
              onChange={(e) => setStartDate(e.target.value)}
              className="date-input"
            />
            <input
              type="date"
              value={endDate}
              onChange={(e) => setEndDate(e.target.value)}
              className="date-input"
            />
            <button type="submit" className="btn btn-primary">
              Search
            </button>
          </form>
        </div>
      </div>

      <div className="container">
        {loading ? (
          <div className="loading">Loading cars...</div>
        ) : cars.length === 0 ? (
          <div className="no-cars">
            <p>No cars available. Try adjusting your search criteria.</p>
          </div>
        ) : (
          <div className="cars-grid">
            {cars.map((car) => (
              <div key={car._id} className="car-card">
                <img src={car.image} alt={car.name} />
                <div className="car-card-content">
                  <h3>{car.name}</h3>
                  <p className="car-brand">{car.brand} {car.model} ({car.year})</p>
                  <div className="car-details">
                    <span>üë• {car.seats} Seats</span>
                    <span>‚öôÔ∏è {car.transmission}</span>
                    <span>‚õΩ {car.fuelType}</span>
                  </div>
                  <div className="car-price">
                    <span className="price">${car.pricePerDay}</span>
                    <span className="price-label">/day</span>
                  </div>
                  <Link to={`/car/${car._id}`} className="btn btn-primary">
                    View Details
                  </Link>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Home;
